import React, {useState} from "react";

const ViewGeotiff = () => {

	const input_params = JSON.stringify({
		state:"ne,ok",
		grid:"1",
		date:"2012-6",
		elems:[{
			name:"maxt",
			interval:"mly",
			duration:"mly",
			reduce:"max",
		}],
		output:"image",
		image:{
			proj:"lcc",
			overlays:["county:1:gray","state:2:purple"],
			interp:"cspline",
			width:350,
			levels:[90,95,100,105,110],
		},
	});

	const [showMap, setShowMap] = useState(false);
	const [mapUrl, setMapUrl] = useState();

	const getMap = () => {
		setShowMap(true);
		setMapUrl("http://data.rcc-acis.org/GridData?params="+input_params);
	}

	return (
		<>
			<button onClick={getMap}>Get Map</button>
			{showMap &&
				<img src={mapUrl}/>
			}
		</>
	);
}

export default ViewGeotiff;
